import React from 'react';


class Home extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            cars_list: []

        }
    }

    componentWillMount(){

        let options = {
            method: 'GET',
            mode: 'cors',
            headers: {
                'Content-Type': 'application/json'
            }
        }

        fetch('http://localhost:4000/cars', options)
            .then((res)=>{

                if (res.status !== 200){
                    console.log('Error retrieving cars list from server: 200');
                }
                else{
                    return res.json();
                }

            })
            .then((data)=>{
                console.log(data);

                this.setState({cars_list: data});
            });




    }




    render(){

        const listElement = this.state.cars_list.map((car)=>{
            return(
                                <li className="list_item"
                                    key={car.Make + '~' + car.Model}>
                                    <div className="make">{car.Make}</div>
                                    <div className="model">{car.Model}</div>
                                </li>
        )})




        return (
            <div>


                <div className="image">
                    <div className="top_wrapper">
                        <div className="number">{this.state.cars_list.length}</div>
                        <div className="title">Cars Remaining with Manual Transmission in the U.S.</div>
                    </div>
                </div>

                <ul className="list">

                        {listElement}

                </ul>


                <div className="footer">

                    Photo Source: 
                    <br/>
                    https://pixabay.com/users/stocksnap-894430/

                    <br/>
                    <br/>

                    Powered By:
                    <br/>   
                    Acar and programming enthusiast (BS4, Requests/HTML-Requests)

                    <br/>
                    <br/>
                    See an Error?
                    <br/>
                    Send an email to savemanuals

                </div>



            </div> 
        )
    }

}

export default Home;
